import '../assets/images/logo.png'

export const Navbar = () => {
    return (
        <ul>
            <li>
                <img src="" />
            </li>
            <li>
                <a href="/">Home</a>
            </li>
            <li >
                <a href="/about">About</a>
            </li>
            <li >
                < a href="/blog" > Blogs</a >
            </li >
        </ul >
    );
}

export default Navbar;
